import { IconFileText, IconBomb, IconWall, IconApple } from '@tabler/icons-react';
import { useState } from "react";
import FileIcon from './Icons/FileIcon.jsx';

function IconColumn({displays, setDisplays}) {
    const [highlight, setHighlight] = useState(null);

    return (
        <div className="flex flex-col w-32 pt-5 pl-7 gap-2">
            <FileIcon display={displays[0]} setDisplay={setDisplays[0]} highlight={highlight} setHighlight={setHighlight} Icon={IconFileText} name="Opening.pdf"/>
            <FileIcon display={displays[1]} setDisplay={setDisplays[1]} highlight={highlight} setHighlight={setHighlight} Icon={IconFileText} name="Projects.pdf"/>
            <FileIcon display={displays[5]} setDisplay={setDisplays[5]} highlight={highlight} setHighlight={setHighlight} Icon={IconFileText} name="Experience.pdf"/>
            <FileIcon display={displays[2]} setDisplay={setDisplays[2]} highlight={highlight} setHighlight={setHighlight} Icon={IconApple} name="Snake"/>
            <FileIcon display={displays[3]} setDisplay={setDisplays[3]} highlight={highlight} setHighlight={setHighlight} Icon={IconBomb} name="MineSweeper"/>
            <FileIcon display={displays[4]} setDisplay={setDisplays[4]} highlight={highlight} setHighlight={setHighlight} Icon={IconWall} name="2048"/>
        </div>
    )
}

export default IconColumn;
